def get_sol(): return Solution3()
class Solution:
    # bad solution
    def minimizeTheDifference(self, mat: List[List[int]], target: int) -> int:
        sett = {0}
        for row in mat:
            tmp=set()
            for x in row:
                for y in sett:
                    tmp.add(x+y)
            sett=tmp

        return min(abs(x-target) for x in sett)
class Solution2:
    def minimizeTheDifference(self, mat: List[List[int]], target: int) -> int:
        def dfs(i, cur_sum):
            if i>=len(m): return abs(cur_sum-target)
            if dp[i][cur_sum]==float('inf'):
                for x in m[i]:
                    dp[i][cur_sum] = min(dp[i][cur_sum], dfs(i + 1, cur_sum + x))
                    if dp[i][cur_sum]==0 or cur_sum+x>70*70+1:
                        break
            return dp[i][cur_sum]

        dp= [[float('inf')]*(70*70+1) for _ in range(71)]
        m = []
        for row in mat:
            m.append(set(row))
        return dfs(0,0)

class Solution3:
    # tle
    def minimizeTheDifference(self, mat: List[List[int]], target: int) -> int:
        def dfs(i, sum):
            if i>=len(m):
                return abs(sum-target)
            if (i,sum) in dp and dp[i,sum]!=float('inf'): return dp[i,sum]
            dp[i,sum]=float('inf')
            for x in m[i]:
                dp[i,sum]= min(dp[i,sum],dfs(i+1,sum+x))
                if dp[i,sum]==0: break
            return dp[i,sum]

        m=[]
        dp={}
        for row in mat:
            m.append(set(row))
        return dfs(0,0)


